import React from 'react';
import logo from './logo.svg';
import './App.css';

import Layout from './components/layout/layout';
import Builder from './containers/builder/builder';

function App() {
  return (
    <div className="App">
      <Layout>
        <Builder/>
      </Layout>
    </div>
  );
}

export default App;
